import React, { Component } from 'react';
import './App.css';
import Map from './components/Map';
import SquareAPI from './API'

class App extends Component {

  componentDidMount() {
    SquareAPI.search({
      near: "Pittsburgh,PA",
      query: "tacos",
      limit: 10
    }).then(results => console.log(results));
  }
  render() {
    return (
    <Map />
    );
  }
}

export default App;
